import React from 'react'; // Import the Component component from React
import {Link} from 'react-router-dom'; // Import the Link component
import ProjectDataLoader from './projectData.js';
import ReactPlayer from 'react-player'


function HomepageProjectVideo(props) {
  const projectData = ProjectDataLoader();
  //console.log(projectData);

  for (var i =0; i<projectData.length; i++){
    if (projectData[i].key === props.projectKey){
      var project = projectData[i]
      //console.log(project)
      break
    }
  }

  return (
    <div className="container-fluid p-md-0 " style={{width:"100%"}}>
      <div className="homepageProjectVideo col-12">
        <div>
          <ReactPlayer
           className='react-player'
           url={props.video}
           playing
           muted
           loop
           height='800px'
           width='100%'
          />
        </div>
        <div className="hp-inner">
          <h1 className="project-title">{project.title}</h1>
          <h2 className="project-question">{project.question}</h2>
        </div>
      </div>
    </div>
  );
}

export default HomepageProjectVideo;
